func convert(nums []int, i int) int {
	tmp := make([]int, 0, len(nums)-1)

	tmp = append(tmp, nums[0:i]...)
	tmp = append(tmp, nums[i+1:]...)

	sum := 1
	for i := range tmp {
		sum *= tmp[i]
	}
	return sum
}

func productExceptSelf(nums []int) []int {

	res := make([]int, len(nums))

	for i := range nums {
		res[i] = convert(nums, i)
	}
	return res
}

